import React from "react";

export default function Game(props) {
  const { join_id, players } = props;
  return (
    <div>
      <div>ID: {join_id}</div>
      <div>Players</div>
      <ol>
        {players.map(player => (
          <li key={player.id}>{player.name}</li>
        ))}
      </ol>
    </div>
  );
}
